@prefix ex: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

ex:BalanceInquiry a owl:Class ;
    rdfs:subClassOf ex:Transaction .

ex:Deposit a owl:Class ;
    rdfs:subClassOf ex:Transaction .

ex:authorizedBy a owl:ObjectProperty ;
    rdfs:domain ex:Transaction ;
    rdfs:range ex:Authorization .

ex:bankCode a owl:DatatypeProperty ;
    rdfs:domain ex:CashCard ;
    rdfs:range xsd:string .

ex:communicates a owl:ObjectProperty ;
    rdfs:domain ex:ATM ;
    rdfs:range ex:Message .

ex:dispensedAmount a owl:DatatypeProperty ;
    rdfs:domain ex:Withdrawal ;
    rdfs:range xsd:decimal .

ex:handlesTransaction a owl:ObjectProperty ;
    rdfs:domain ex:ATM ;
    rdfs:range ex:Transaction .

ex:hasAccount a owl:ObjectProperty ;
    rdfs:domain ex:Customer ;
    rdfs:range ex:Account .

ex:issuesCard a owl:ObjectProperty ;
    rdfs:domain ex:Bank ;
    rdfs:range ex:CashCard .

ex:maintainsAccount a owl:ObjectProperty ;
    rdfs:domain ex:Bank ;
    rdfs:range ex:Account .

ex:messageCode a owl:DatatypeProperty ;
    rdfs:domain ex:Message ;
    rdfs:range xsd:string .

ex:onAccount a owl:ObjectProperty ;
    rdfs:domain ex:Transaction ;
    rdfs:range ex:Account .

ex:operatedBy a owl:ObjectProperty ;
    rdfs:domain ex:ATM ;
    rdfs:range ex:Bank .

ex:ownsCard a owl:ObjectProperty ;
    rdfs:domain ex:Customer ;
    rdfs:range ex:CashCard .

ex:performedBy a owl:ObjectProperty ;
    rdfs:domain ex:Transaction ;
    rdfs:range ex:Customer .

ex:requestedAmount a owl:DatatypeProperty ;
    rdfs:domain ex:Transaction ;
    rdfs:range xsd:decimal .

ex:serialNumber a owl:DatatypeProperty ;
    rdfs:domain ex:CashCard ;
    rdfs:range xsd:string .

ex:transactionTimestamp a owl:DatatypeProperty ;
    rdfs:domain ex:Transaction ;
    rdfs:range xsd:dateTime .

ex:usesCard a owl:ObjectProperty ;
    rdfs:domain ex:Transaction ;
    rdfs:range ex:CashCard .

ex:Authorization a owl:Class .

ex:Withdrawal a owl:Class ;
    rdfs:subClassOf ex:Transaction .

ex:Message a owl:Class .

ex:ATM a owl:Class .

ex:Account a owl:Class .

ex:Bank a owl:Class .

ex:Customer a owl:Class .

ex:CashCard a owl:Class .

ex:Transaction a owl:Class .
